B.MB=new A.uK("Templates","Templates are high-level page layouts that demonstrate how to combine Atoms, Molecules, and Organisms into complete screens.\n\n### Playground Template\nThe **Playground Template** is a dynamic tool that allows you to:\n1. **Experiment with Layouts**: Test different AppBar, Body, and Footer combinations.\n2. **Component Synergy**: See how components look and feel when placed together.\n3. **Response Verification**: Check how your designs behave on different screen sizes using the Grid and Box systems.\n\nUse the Knobs to customize the template parts and assembly your own screen!\n",null)
B.MC=new A.uK("Layout System","The Layout System provides structural components to organize UI elements consistently.\n\n### AtomixGrid\nA responsive 12-column grid system.\n- Use `AtomixCol` to specify the span (1-12).\n- Automatic Gutter management using `AtomixSpacing`.\n\n### AtomixBox\nA versatile container that integrates with all Foundation tokens.\n- Apply `padding`, `margin`, `radius`, and `elevation` effortlessly.\n- Standardizes background management.\n\n### Best Practices\n- Use `AtomixBox` as the base for all custom containers.\n- Prefer `AtomixGrid` for horizontally aligned elements to ensure responsiveness.\n- Use `AtomixSpacer` for simple vertical spacing between items.\n",null)
B.MD=new A.uK("Atomic Components","Atoms are the basic building blocks of our Design System. They are the smallest functional units (like buttons, icons, or labels) that cannot be broken down further without losing their functionality.\n\n### Core Principles\n1. **Purity**: Atoms should be simple and focused on a single task.\n2. **Consistency**: They use Foundation tokens (colors, spacing, shadows) to ensure a unified look.\n3. **Versatility**: Atoms are designed to be reused across all Compounds (Molecules and Organisms).\n\n### Catalog\nBrowse the **Overview Gallery** to see all available atoms in one place, or explore individual components to see their specific Knobs and variants.\n",null)
